import './App.css';
import Electronic from "./Allpage/Electronic.jsx";
import Mobile from "./Allpage/Mobile.jsx";
import Navbar from './Navbar';
import { Switch, Route } from "react-router-dom";



function App() {
  return (
    <>

      <div className="header">
        <img src="Logoimg/Logoimg.jpg" alt="BigCo Inc. logo" width="180px" height="80px" />
        <input type="text" placeholder="Search.." />
        <button type="submit">Search<i class="fa fa-shopping-cart"></i></button>
        <img src="Logoimg/Sidelogo.jpg" alt="BigCo Inc. logo" width="600px" height="80px" />
      </div>
      <div>
        <Navbar />
      </div>
      <div className="banner">
        <img src="Banner/Banner.jpg" alt="BigCo Inc. logo" width="100px" height="400px" />
      </div>

      <Switch>
        <Route path="/electronic" component={Electronic} />
        <Route path="/mobile" component={Mobile} />
      </Switch>

    </>
  );
}

export default App;
